import React, { memo, useState } from 'react';
import Background from '../components/Background';
import Header from '../components/Header';
import Paragraph from '../components/Paragraph';
import Button from '../components/Button';
import { ScrollView } from 'react-native';
import global from '../global.js';

const TimeSummary = ({ navigation, route }) => {
  const _refreshList = () => {
    fetch('http://192.168.1.13:3000/timetracker', {
      method: 'GET',
    })
      .then(response => response.json())
      .then(json => {
        console.log(json);
        setData(json);
      });
  };

  const [data, setData] = useState([]);

  return (
    <Background>
      <ScrollView>
        <Header>Time Summary</Header>
        <Button mode="outlined" onPress={_refreshList}>
          Refresh
        </Button>
        {data.map((item, index) => (
          <Paragraph>
            {item.timetracker_clockindate}: {item.timetracker_clockintime} - {item.timetracker_clockouttime}
          </Paragraph>
        ))}
      </ScrollView>
    </Background>
  );
};

export default memo(TimeSummary);
